const clientId=  "MegpxqNBfl4cqRKE7exYseBi1sjuO5lD";
const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <Auth0Provider 
    domain={domain}
   clientId={clientId}
   redirectUri={window.location.origin}>
    <App />
  </Auth0Provider>

);

